	ClearFlags();
	ToggleFlag(Flag::Carry, ((SP ^ n ^ HL) & 0x100) == 0x100);
	ToggleFlag(Flag::Half_Carry, ((SP ^ n ^ HL) & 0x10) == 0x10);

	return 12;
