/* CP n */
unsigned int Processor::CP_n() // 0xFE
{
	uint8 value = memory->ReadByte(PC++);
	SetFlags(Flag::Sub);
	ToggleFlag(Flag::Carry, A < value);
	ToggleFlag(Flag::Zero, A == value);
	ToggleFlag(Flag::Half_Carry, ((A - value) & 0xF) > (A & 0xF));

	return 8;
}

